export const stationSearchMockAPI = async (
  searchText: string,
  { signal }: { signal: AbortSignal }
): Promise<Array<StationOption>> => {
  if (signal.aborted) {
    console.log('Station Search API canceled');
    return Promise.reject({
      code: 'ERR_CANCELED',
      message: 'Canceled',
    });
  }
  console.log('Station Search API called');
  return new Promise((resolve, reject) => {
    setTimeout(() => {
      resolve(
        _stationList.filter(
          ({ stationCode, stationName }) =>
            stationCode.includes(searchText.toUpperCase()) || stationName.includes(searchText)
        )
      );
    }, 1300);
    signal.addEventListener('abort', () => {
      console.log('Station Search API canceled');
      reject({
        code: 'ERR_CANCELED',
        message: 'Canceled',
      });
    });
  });
};
